import React from 'react';
import './App.css';
import internal from 'stream';

interface MyProps {
};

interface Farm{
  premise_id : number;
  name : string;
  address : string;
  city : string;
  state: string;
  postal_code: number;
  total_population: number;
}

interface MyState {
  status: string;
  data: Farm[];
};

class App extends React.Component<MyProps,MyState>{
  constructor(props : MyProps){
    super(props);
    this.state = {
      status: "Fetching records..",
      data: [{
        premise_id : 0,
        name : '',
        address : '',
        city : '',
        state: '',
        postal_code: 0,
        total_population: 0
      }]
    };
  }

  async componentDidMount() {
    try {
      const res = await fetch('http://localhost:8000/farm/');
      const temp = await res.json()

      this.setState({
        status : temp["status"],
        data: temp["data"]
      });

      console.log(this.state.data)
    } catch (e) {
      console.log(e);
    }
  }

  render(): React.ReactNode {
    return (
      <div className='ap'>
        <table className='movement_table'>
          <thead>
            <tr>
                <th>No</th>
                <th>Premise Id</th>
                <th>Name</th>
                <th>Address</th>
                <th>City</th>
                <th>State</th>
                <th>Postal Code</th>
                <th>Total Population</th>
            </tr>
          </thead>
          <tbody>
          {this.state.data.map((data,index) => {
            return (
            <tr>
              <td>{index+1}</td>
              <td>{data.premise_id}</td>
              <td>{data.name}</td>
              <td>{data.address}</td>
              <td>{data.city}</td>
              <td>{data.state}</td>
              <td>{data.postal_code}</td>
              <td>{data.total_population}</td>
            </tr>
            )
            })}
          </tbody>
        </table>
      </div>
    )
  }
}

export default App;
